Defendant in custody.
The defendant is sentenced to the Wisconsin State Prison System for a total of eight (8) years.  That is three (3) years initial confinement followed by five (5) years extended supervision. 
The defendant has credit for 204 days.
The Court finds the defendant eligible for both the Challenge Incarceration Program and the Substance Abuse Program.
Conditions of extended supervision:
1) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
2) Pay court costs;
3) pay supervision fees in an amount to be determined by DOC;
4) provide DNA sample and pay the surcharge;
5) maintain fulltime employment, schooling or work search;
6) maintain absolute sobriety.
